CREATE TABLE `empresa_resoluciones` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `empresa_id` int(11) NOT NULL COMMENT 'id de la empresa',
  `tipo_documento_id` int(11) NOT NULL COMMENT 'id del tipo de documento',
  `prefijo` varchar(25) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'prefijo de la numeracion',
  `numero_resolucion` varchar(45) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'numero de la resolucion',
  `fecha_resolucion` date NOT NULL COMMENT 'fecha de la resolucion',
  `llave_tecnica` varchar(200) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'llave tecnica',
  `desde` bigint(20) NOT NULL COMMENT 'rango de numeracion desde',
  `hasta` bigint(20) NOT NULL COMMENT 'rango de numeracion hasta',
  `fecha_desde` date NOT NULL COMMENT 'fecha desde',
  `fecha_hasta` date NOT NULL COMMENT 'fecha hasta',
  `proximo_numero_documento` bigint(20) NOT NULL COMMENT 'proximo numero de documento para esta resolucion',
  `resolucion_id_api` int(11) NOT NULL COMMENT 'id de la resolucion en el api',
  `estado` int(11) NOT NULL DEFAULT '1' COMMENT '1 activa, 2 completada, 3 vencida',
  `created` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP COMMENT 'fecha de creacion del registro',
  PRIMARY KEY (`ID`),
  KEY `tipo_documento_id` (`tipo_documento_id`),
  KEY `empresa_id` (`empresa_id`),
  KEY `prefijo` (`prefijo`),
  KEY `numero_resolucion` (`numero_resolucion`),
  KEY `resolucion_id_api` (`resolucion_id_api`),
  KEY `estado` (`estado`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;

