CREATE TABLE `documentos_electronicos` (
  `ID` bigint(20) NOT NULL AUTO_INCREMENT,
  `documento_electronico_id` varchar(90) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'identificador unico del documento',
  `fecha` date NOT NULL COMMENT 'fecha del documento',
  `hora` time NOT NULL COMMENT 'hora del documento',
  `tipo_documento_id` int(11) NOT NULL COMMENT 'tipo del documento electronico',
  `resolucion_id` int(11) NOT NULL COMMENT 'id de la resolucion a usar',
  `prefijo` varchar(45) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'prefijo de la resolucion',
  `numero` bigint(20) NOT NULL COMMENT 'numero del documento',
  `tercero_id` bigint(20) NOT NULL COMMENT 'id del tercero asociado al documento',
  `uuid` varchar(200) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'identificador ante la dian o CUFE',
  `base64_pdf` longtext CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'base 64 del pdf documento',
  `base64_xml` longtext CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'base 64 del xml del documento',
  `base64_zip` longtext CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'base 64 del zip con el xml del documento',
  `is_valid` int(11) NOT NULL COMMENT 'indica si el documento es valido o tiene errores',
  `errors` text CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'describe los errore que tiene el documento',
  `usuario_id` int(11) NOT NULL COMMENT 'id del usuario que realiza el documento',
  `notas` text CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'notas u observaciones del documento',
  `orden_compra` varchar(100) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'orden de compra del documento',
  `forma_pago` int(11) NOT NULL COMMENT 'forma de pago de una factura electronica',
  `documento_asociado_id` varchar(90) CHARACTER SET utf8 COLLATE utf8_spanish_ci NOT NULL COMMENT 'documento asociado cuando es una nota credito o debito',
  `created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`ID`),
  KEY `tipo_documento_id` (`tipo_documento_id`),
  KEY `resolucion_id` (`resolucion_id`),
  KEY `prefijo` (`prefijo`),
  KEY `numero` (`numero`),
  KEY `tercero_id` (`tercero_id`),
  KEY `uuid` (`uuid`),
  KEY `is_valid` (`is_valid`),
  KEY `usuario_id` (`usuario_id`),
  KEY `documento_electronico_id` (`documento_electronico_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_spanish_ci;


CREATE TABLE `documentos_electronicos_items` (
