DROP TABLE IF EXISTS `empresa_resoluciones`;
CREATE TABLE `empresa_resoluciones` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `empresa_id` int(11) NOT NULL COMMENT 'id de la empresa',
  `tipo_documento_id` int(11) NOT NULL COMMENT 'id del tipo de documento',
  `prefijo` varchar(25) COLLATE utf8_spanish_ci NOT NULL COMMENT 'prefijo de la numeracion',
  `numero_resolucion` varchar(45) COLLATE utf8_spanish_ci NOT NULL COMMENT 'numero de la resolucion',
  `fecha_resolucion` date NOT NULL COMMENT 'fecha de la resolucion',
  `llave_tecnica` varchar(200) COLLATE utf8_spanish_ci NOT NULL COMMENT 'llave tecnica',
  `desde` bigint(20) NOT NULL COMMENT 'rango de numeracion desde',
  `hasta` bigint(20) NOT NULL COMMENT 'rango de numeracion hasta',
  `fecha_desde` date NOT NULL COMMENT 'fecha desde',
  `fecha_hasta` date NOT NULL COMMENT 'fecha hasta',
  `proximo_numero_documento` bigint(20) NOT NULL COMMENT 'proximo numero de documento para esta resolucion',
